            background-size: cover;
            background-position: center top;
            background-repeat: no-repeat;
        }
        .logo {
            margin: 0 auto 8px;
            width: 343px;
            height: 89px;
        }
        .logo img {
            width: 100%;
            height: 100%;
        }

        .center {
            position: absolute;
            left: 50%;
            top: 73%;
            transform: translate(-50%, -50%);

            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;

            width: 363px;
            height: 216px;
            padding: 7px 33px 28px;
            background: rgba(47, 42, 42, 0.87);
            border-radius: 36px;

            text-align: center;
        }
        .text-limited {
            font-family: 'Playfair Display', serif;
            font-style: normal;
            font-weight: 900;
            font-size: 24px;
            line-height: 32px;
            color: #FFF8F8;
        }
        .text-xo {
            font-size: 30px;
            line-height: 37px;
            text-align: center;
            color: #EB2629;
            margin-bottom: 8px;
        }

        .btn {
            display: flex;
            justify-content: center;
            align-items: center;
            min-width: 92%;
            min-height: 63px;
            background: #DC0014;
            border-radius: 15px;
            font-family: 'Playfair Display', serif;
            font-style: normal;
            font-weight: bold;
            font-size: 36px;
            line-height: 48px;
            text-align: center;
            color: #FFFFFF;
            text-decoration: none;
        }

        @media (max-width: 411px) {
            main {
                max-width: 90%;
            }
        }

        @media (max-width: 375px) {
            .center {
                width: 90%;
            }
            .logo {
                width: 100%;
                height: auto;
            }
            .text-limited {
                font-size: 16px;
            }
            .text-xo {
                font-size: 24px;
                line-height: 28px;
            }
            .btn {
                font-size: 30px;
            }
        }

        @media (max-height: 500px) {
            .center {
                top: 50%;
            }
        }

        @media (max-height: 500px) and (orientation: landscape) {
            .center {
                top: 64%;
            }
        }

        @media (max-height: 375px) and (orientation: landscape) {
            .text-limited {
                font-size: 16px;
            }
            .text-xo {
                font-size: 24px;
                line-height: 28px;
            }
            .btn {
                font-size: 30px;
            }
            .center {
                top: 64%;
                height: fit-content;
            }
        }
        @media (max-height: 288px) and (orientation: landscape) {
            .center {
                padding: 0px 33px 7px;
            }
        }
    </style>
